  `pa_ratioRemark` varchar(20) DEFAULT NULL COMMENT '平博佔成備註',
  `agent_uid` varchar(32) DEFAULT NULL COMMENT '代理登入Uid',
  `agent_remark` varchar(64) DEFAULT NULL COMMENT '代理備註',
